                                = \"target\"\nlocal Temp                                     = {\n    TotalAndPhys                            = {\"TotalImun\", \"DamagePhysImun\"},\n    TotalAndPhysKick                        = {\"TotalImun\", \"DamagePhysImun\", \"KickImun\"},\n    TotalAndPhysAndCC                        = {\"TotalImun\", \"DamagePhysImun\", \"CCTotalImun\"},\n    TotalAndPhysAndStun                     = {\"TotalImun\", \"DamagePhysImun\", \"StunImun\"},\n    TotalAndPhysAndCCAndStun                 = {\"TotalImun\", \"DamagePhysImun\", \"CCTotalImun\", \"StunImun\"},\n    DisablePhys                                = {\"TotalImun\", \"DamagePhysImun\", \"Freedom\", \"CCTotalImun\"},\n    TotalAndMagPhys                            = {\"TotalImun\", \"DamageMagicImun\", \"DamagePhysImun\"},\n    CastStartTime                            = {},\n    StealthBuff                                = {A.Stealth.ID, A.VanishBuff.ID},\n    IsSlotTrinketBlocked                    = {},\n    IsDanceSap                                = false,\n}\nlocal function InMelee(unitID)\n    -- @return boolean\n    return A.Backstab:IsInRange(unitID)\nend\n-- Reset Vars\nlocal function ResetVars()\n    if Temp.IsDanceSap then\n        Temp.IsDanceSap = false\n    end\nend\nTMW:RegisterCallback(\"TMW_ACTION_ENTERING\", ResetVars)\n\nlocal function countInterruptGCD(unitID)\n    if not A.Kick:IsReadyByPassCastGCD(unitID) or not A.Kick:AbsentImun(unitID, Temp.TotalAndPhysKick, true) then \n        return true \n    end \nend\n\nfunction Action:IsLatenced(delay)\n    -- @return boolean \n    return TMW.time - (Temp.CastStartTime[self:Info()] or 0) > (delay or 0.1)\nend\n\nlocal function GetByRange(count, range, isCheckEqual, isCheckCombat)\n    -- @return boolean\n    local c = 0\n    for unitID in pairs(ActiveUnitPlates) do\n        if (not isCheckEqual or not UnitIsUnit(target, unitID)) and (not isCheckCombat or Unit(unitID):CombatTime() > 0) and not Unit(unitID):IsExplosives() and not Unit(unitID):IsTotem() then\n            if InMelee(unitID) then\n                c = c + 1\n            elseif range then\n                local r = Unit(unitID):GetRange()\n                if r > 0 and r <= range then\n                    c = c + 1\n                end\n            end\n            \n            if c >= count then\n                return true\n            end\n        end\n    end\nend\n\n-- [2] Kick AntiFake Rotation\nA[2] = function(icon)        \n    local unitID\n    if IsUnitEnemy(\"mouseover\") then \n        unitID = \"mouseover\"\n    elseif IsUnitEnemy(\"target\") then \n        unitID = \"target\"\n    end \n    \n    if unitID then         \n        local castLeft, _, _, _, notKickAble = Unit(unitID):IsCastingRemains()\n        if castLeft > 0 then             \n            if not notKickAble and A.KickGreen:IsReady(unitID, nil, nil, true) and A.KickGreen:AbsentImun(unitID, Temp.TotalAndPhysKick, true) then\n                return A.KickGreen:Show(icon)                                                  \n            end\n            \n            -- Racials \n            if A.QuakingPalm:IsRacialReadyP(unitID, nil, nil, true) then \n                return A.QuakingPalm:Show(icon)\n            end \n            \n            if A.Haymaker:IsRacialReadyP(unitID, nil, nil, true) then \n                return A.Haymaker:Show(icon)\n            end \n            \n            if A.WarStomp:IsRacialReadyP(unitID, nil, nil, true) then \n                return A.WarStomp:Show(icon)\n            end \n            \n            if A.BullRush:IsRacialReadyP(unitID, nil, nil, true) then \n                return A.BullRush:Show(icon)\n            end                         \n        end \n    end                                                                                 \nend\n-----------------------------------------\n--                 ROTATION  \n-----------------------------------------\n-- Locals - Other\nlocal function SelfDefensives()\n    -- Evasion\n    local Evasion = GetToggle(2, \"Evasion\")\n    if Evasion >= 0 and A.Evasion:IsReady(player) and \n    (\n        (     -- Auto \n            Evasion >= 100 and \n            (\n                -- HP lose per sec >= 20\n                Unit(player):GetDMG() * 100 / Unit(player):HealthMax() >= 50 or \n                Unit(player):GetRealTimeDMG() >= Unit(player):HealthMax() * 0.50 or \n                -- TTD \n                Unit(player):TimeToDieX(25) < 2 or \n                (\n                    A.IsInPvP and Unit(player):HealthPercent() <= 40 and\n                    (\n                        Unit(player):UseDeff() or \n                        (\n                            Unit(player, 5):HasFlags() and \n                            Unit(player):GetRealTimeDMG() > 0 and \n                            Unit(player):IsFocused() \n                        )\n                    )\n                )\n            ) and \n            Unit(player):HasBuffs(\"DeffBuffs\", true) == 0\n        ) or \n        (    -- Custom\n            Evasion < 100 and \n            Unit(player):HealthPercent() <= Evasion\n        )\n    ) \n    then \n        return A.Evasion\n    end\n    \n    -- CloakofShadows\n    local CloakofShadows = GetToggle(2, \"CloakofShadows\")\n    if CloakofShadows >= 0 and A.CloakofShadows:IsReady(player) and \n    (\n        (     -- Auto \n            CloakofShadows >= 100 and \n            Unit(player):TimeToDieMagicX(25) < 2 and \n            -- Magic Damage still appear\n            Unit(player):GetRealTimeDMG(4) > 0 and \n            Unit(player):HasBuffs(\"DeffBuffsMagic\") == 0\n        ) or \n        (    -- Custom\n            CloakofShadows < 100 and \n            Unit(player):HealthPercent() <= CloakofShadows\n        )\n    ) \n    then \n        return A.CloakofShadows\n    end\n    \n    -- Stoneform (On Deffensive)\n    local Stoneform = GetToggle(2, \"Stoneform\")\n    if     Stoneform >= 0 and A.Stoneform:IsRacialReadyP(player) and \n    (\n        (     -- Auto \n            Stoneform >= 100 and \n            (\n                (\n                    not A.IsInPvP and                         \n                    Unit(player):TimeToDieX(65) < 3 \n                ) or \n                (\n                    A.IsInPvP and \n                    (\n                        Unit(player):UseDeff() or \n                        (\n                            Unit(player, 5):HasFlags() and \n                            Unit(player):GetRealTimeDMG() > 0 and \n                            Unit(player):IsFocused()                                 \n                        )\n                    )\n                )\n            ) \n        ) or \n        (    -- Custom\n            Stoneform < 100 and \n            Unit(player):HealthPercent() <= Stoneform\n        )\n    ) \n    then \n        return A.Stoneform\n    end\n    \n    -- Feint\n    local Feint = GetToggle(2, \"Feint\")        \n    if Feint >= 0 and A.Feint:IsReady(player) and\n    (\n        (    -- Auto\n            Feint >= 100 and (Unit(player):IsTankingAoE(16) or A.Elusiveness:IsSpellLearned()) and Unit(player):GetRealTimeDMG() > 0 and\n            (\n                Unit(player):TimeToDieX(60) < 2 or\n                (\n                    A.IsInPvP and \n                    Unit(player):HealthPercent() < 80 and \n                    Unit(player):IsFocused(nil, true) \n                )\n            )\n        ) or -- Custom\n        (\n            Feint < 100 and\n            Unit(player):HealthPercent() < Feint\n        )\n    )\n    then \n        return A.Feint\n    end\n    \n    -- CrimsonVial \n    local CrimsonVial = GetToggle(2, \"CrimsonVial\")\n    if CrimsonVial >= 0 and IsUnitEnemy(\"target\") and A.CrimsonVial:IsReady(player) and Unit(player):HealthPercent() <= CrimsonVial then\n        return A.CrimsonVial\n    end\n    \n    -- Stoneform (Self Dispel)\n    if not A.IsInPvP and A.Stoneform:IsRacialReady(player, true) and AuraIsValid(player, \"UseDispel\", \"Dispel\") then \n        return A.Stoneform\n    end\nend\nlocal function Interrupts(unitID)\n    local useKick, useCC, useRacial, notInterruptable, castRemainsTime = InterruptIsValid(unitID,  nil, nil, countInterruptGCD(unitID))    \n    \n    -- Can waste interrupt action due delays caused by ping, interface input \n    if castRemainsTime < GetLatency() then \n        return \n    end \n    \n    if useKick and not notInterruptable and A.Kick:IsReady(unitID) and A.Kick:AbsentImun(unitID, Temp.TotalAndPhysKick, true) then \n        return A.Kick\n    end         \n    \n    if useRacial and A.QuakingPalm:AutoRacial(unitID) then \n        return A.QuakingPalm\n    end \n    \n    if useRacial and A.Haymaker:AutoRacial(unitID) then \n        return A.Haymaker\n    end \n    \n    if useRacial and A.WarStomp:AutoRacial(unitID) then \n        return A.WarStomp\n    end \n    \n    if useRacial and A.BullRush:AutoRacial(unitID) then \n        return A.BullRush\n    end\nend\n\nlocal function num(val)\n    if val then return 1 else return 0 end\nend\n\nlocal function bool(val)\n    return val ~= 0\nend\n\nlocal function UseItems(unitID)\n    if A.Trinket1:IsReady(unitID) and A.Trinket1:GetItemCategory() ~= \"DEFF\" and not Temp.IsSlotTrinketBlocked[A.Trinket1.ID] and A.Trinket1:AbsentImun(unitID, Temp.TotalAndMagPhys) then \n        return A.Trinket1\n    end\n    \n    if A.Trinket2:IsReady(unitID) and A.Trinket2:GetItemCategory() ~= \"DEFF\" and not Temp.IsSlotTrinketBlocked[A.Trinket2.ID] and A.Trinket2:AbsentImun(unitID, Temp.TotalAndMagPhys) then \n        return A.Trinket2\n    end\nend\n-----------------------------------------\n--                 ROTATION\n-----------------------------------------\n-- [3] Single Rotation\nA[3] = function(icon)\n    local EnemyRotationPvE, FriendlyRotation, EnemyRotationPvP\n    local isMoving             = Player:IsMoving()                    -- @boolean \n    local inCombat             = Unit(player):CombatTime()            -- @number \n    local inAoE                = GetToggle(2, \"AoE\")                -- @boolean \n    local inDisarm            = LoC:Get(\"DISARM\") > 0                -- @boolean\n    local inMelee             = false                                -- @boolean\n    local inStealth            = Player:IsStealthed()                -- @boolean\n    local forcecombat            = GetToggle(2, \"FCOMBAT\") or Unit(player):CombatTime() > 0 \n    \n    -- [[ Defensive ]]\n    if inCombat > 0 then \n        local SelfDefensive = SelfDefensives()\n        if SelfDefensive then \n            return SelfDefensive:Show(icon)\n        end\n        \n        -- Defensive Trinkets\n        if Unit(player):HealthPercent() <= GetToggle(2, \"TrinketDefensive\") then \n            if A.Trinket1:IsReady(player, true) and A.Trinket1:GetItemCategory() ~= \"DPS\" and not Temp.IsSlotTrinketBlocked[A.Trinket1.ID] then \n                return A.Trinket1:Show(icon)\n            end \n            \n            if A.Trinket2:IsReady(player, true) and A.Trinket2:GetItemCategory() ~= \"DPS\" and not Temp.IsSlotTrinketBlocked[A.Trinket2.ID] then \n                return A.Trinket2:Show(icon)\n            end             \n        end         \n    end\n    \n    -- [[ LEGENDARY ]]\n    if GetToggle(2, \"HasLegendaryEquipped\") ~= \"NONE\" then\n        local LegendaryEquipped = GetToggle(2, \"HasLegendaryEquipped\")\n        local MarkoftheMasterAssassinEquipped\n        local TinyToxicBladeEquipped\n        local DeathlyShadowsEquipped\n        local AkaarisSoulFragmentEquipped\n        if LegendaryEquipped == \"MOTMA\" then\n            MarkoftheMasterAssassinEquipped = LegendaryEquipped\n        end\n        if LegendaryEquipped == \"TTB\" then\n            TinyToxicBladeEquipped = LegendaryEquipped\n        end\n        if LegendaryEquipped == \"DS\" then\n            DeathlyShadowsEquipped = LegendaryEquipped\n        end\n        if LegendaryEquipped == \"ASF\" then\n            AkaarisSoulFragmentEquipped = LegendaryEquipped\n        end\n    end\n    \n    \n    -- [[ POISONS ]]\n    if (Player:IsStayingTime() > 0.7 or inCombat) and not Player:IsMounted() then\n        local MainHand_Option, OffHand_Option = GetToggle(2, A.IsInPvP and \"MainHandEnchantNamePvP\" or \"MainHandEnchantNamePvE\"), GetToggle(2, A.IsInPvP and \"OffHandEnchantNamePvP\" or \"OffHandEnchantNamePvE\")\n        if MainHand_Option ~= \"OFF\" then\n            if MainHand_Option == \"AUTO\" then\n                if A.IsInPvP and A.WoundPoison:IsReady(player) and A.WoundPoison:IsLatenced(GetGCD() + 0.5) and Unit(player):HasBuffs(A.WoundPoison.ID, true) <= 10 then\n                    return A.WoundPoison:Show(icon)\n                elseif not A.IsInPvP and A.InstantPoison:IsReady(player) and A.InstantPoison:IsLatenced(GetGCD() + 0.5) and Unit(player):HasBuffs(A.InstantPoison.ID, true) <= 10 then\n                    return A.InstantPoison:Show(icon)\n                end\n            end\n            \n            if MainHand_Option == \"WoundPoison\" and A.WoundPoison:IsReady(player) and A.WoundPoison:IsLatenced(GetGCD() + 0.5) and Unit(player):HasBuffs(A.WoundPoison.ID, true) <= 10 then\n                return A.WoundPoison:Show(icon)\n            end\n            \n            if MainHand_Option == \"InstantPoison\" and A.InstantPoison:IsReady(player) and A.InstantPoison:IsLatenced(GetGCD() + 0.5) and Unit(player):HasBuffs(A.InstantPoison.ID, true) <= 10 then\n                return A.InstantPoison:Show(icon)\n            end\n        end\n        \n        if OffHand_Option ~= \"OFF\" then\n            if OffHand_Option == \"AUTO\" then\n                if A.CripplingPoison:IsReady(player) and A.CripplingPoison:IsLatenced(GetGCD() + 0.5) and Unit(player):HasBuffs(A.CripplingPoison.ID, true) <= 10 then\n                    return A.CripplingPoison:Show(icon)\n                end\n            end\n            \n            if OffHand_Option == \"CripplingPoison\" and A.CripplingPoison:IsReady(player) and A.CripplingPoison:IsLatenced(GetGCD() + 0.5) and Unit(player):HasBuffs(A.CripplingPoison.ID, true) <= 10 then\n                return A.CripplingPoison:Show(icon)\n            end\n            \n            if OffHand_Option == \"NumbingPoison\" and A.NumbingPoison:IsReady(player) and A.NumbingPoison:IsLatenced(GetGCD() + 0.5) and Unit(player):HasBuffs(A.NumbingPoison.ID, true) <= 10 then\n                return A.NumbingPoison:Show(icon)\n            end            \n        end\n    end\n    \n    -- [[ STEALTH (OOC) ]]\n    local StealthMode = GetToggle(2, \"StealthMode\")\n    if not Player:IsMounted() and not inStealth and StealthMode ~= \"OFF\" then\n        if StealthMode == \"AUTO\" and A.Zone ~= \"none\" and A.Stealth:IsReady(player) then\n            return A.Stealth:Show(icon)\n        end\n        \n        if StealthMode == \"PvP\" and (A.Zone == \"pvp\" or A.Zone == \"arena\" or A.IsInDuel) and A.Stealth:IsReady(player) then\n            return A.Stealth:Show(icon)\n        end\n        \n        if StealthMode == \"Dungeon\" and (A.Zone == \"party\" or A.Zone == \"scenario\") and A.Stealth:IsReady(player) then\n            return A.Stealth:Show(icon)\n        end\n        \n        if StealthMode == \"Raid\" and A.Zone == \"raid\" and A.Stealth:IsReady(player) then\n            return A.Stealth:Show(icon)\n        end\n        \n        if StealthMode == \"Always\" and A.Stealth:IsReady(player) then\n            return A.Stealth:Show(icon)\n        end\n    end\n    \n    -- Rotations\n    function EnemyRotationPvE(unitID)\n        -- Variables\n        local isBurst            = BurstIsON(unitID)\n        local isPrioRotation    = GetByRange(2, 10)\n        local energyPoolBurst     = 0\n        local inMelee                 = GetByRange(1, 8)\n        local EchoingReprimandCP = Unit(player):HasBuffsStacks(A.EchoingReprimand2.ID)\n        local sndcondition = Unit(player):HasBuffs(A.SliceandDice.ID) > 0 or (inAoE and GetByRange(6, 10))\n        \n        if A.Vigor:IsSpellLearned() then\n            energyPoolBurst = GetToggle(2, \"PoolEnergyVigorPvE\")\n        else\n            energyPoolBurst = GetToggle(2, \"PoolEnergyPvE\")\n        end\n        \n        if Unit(player):HasBuffs(\"BurstHaste\") > 0 or Unit(player):HasBuffs(A.ShadowDanceBuff.ID, true) > 0 then\n            energyPoolBurst = 0\n        end\n        \n        -- Stealth with target Enemy\n        if GetToggle(2, \"StealthTarget\") and A.Stealth:IsReady(player) and not Player:IsMounted() and not inStealth then\n            return A.Stealth:Show(icon)\n        end\n        \n        -- Check if target is explosive or totem for dont use AoE spells\n        if Unit(unitID):IsExplosives() or (A.Zone ~= \"none\" and Unit(unitID):IsTotem()) then\n            inAoE = false\n        end\n        \n        -- Purge\n        if A.Shiv:IsReady(unitID) and Unit(player):HasBuffs(A.NumbingPoison.ID) > 0 and AuraIsValid(unitID, \"UseExpelEnrage\", \"Enrage\") then\n            return A.Shiv:Show(icon)\n        end \n        if A.ArcaneTorrent:AutoRacial(unitID) then \n            return A.ArcaneTorrent:Show(icon)\n        end             \n        \n        -- Interrupts\n        local Interrupt = Interrupts(unitID)\n        if Interrupt then \n            return Interrupt:Show(icon)\n        end\n        \n        --/stealth_threshold,value=25+talent.vigor.enabled*20+talent.master_of_shadows.enabled*20+talent.shadow_focus.enabled*25+talent.alacrity.enabled*20+25*(spell_targets.shuriken_storm>=4)\n        local stealthThreshold = 25 + num(A.Vigor:IsSpellLearned()) * 20 + num(A.MasterofShadows:IsSpellLearned()) * 20 + num(A.ShadowFocus:IsSpellLearned()) + 25 + num(A.Alacrity:IsSpellLearned()) * 20 + 25 * num(MultiUnits:GetByRange(8, 4) > 3 and inAoE or not inAoE)\n        local function PrePull()\n            if GetToggle(2, \"Tricks\") and A.TricksOfTheTrade:IsReady(\"focus\") and (BossMods:GetPullTimer() > .1 and BossMods:GetPullTimer() <= 2.5)then\n                return A.TricksOfTheTrade:Show(icon)\n            end    \n        end\n        -- [[ Builder ]]\n        local function Build()\n            --actions.build=shiv,if=!talent.nightstalker.enabled&runeforge.tiny_toxic_blade&spell_targets.shuriken_storm<5\n            --actions.build+=/shuriken_storm,if=spell_targets>=2\n            if A.ShurikenStorm:IsReady(unitID, true) and inMelee and inAoE and GetByRange(2, 10) and A.ShurikenStorm:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.ShurikenStorm:Show(icon)\n            end\n            --actions.build+=/serrated_bone_spike,if=cooldown.serrated_bone_spike.charges_fractional>=2.75|soulbind.lead_by_example.enabled&!buff.lead_by_example.up\n            if A.SerratedBoneSpike:IsReady(player) and A.SerratedBoneSpike:GetSpellChargesFrac() >= 2.75 and A.SerratedBoneSpike:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.SerratedBoneSpike:Show(icon)\n            end\n            --actions.build+=/gloomblade\n            if A.Gloomblade:IsReady(unitID) and A.Gloomblade:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.Gloomblade:Show(icon)\n            end\n            --actions.build+=/backstab\n            if A.Backstab:IsReady(unitID) and A.Backstab:AbsentImun(unitID, Temp.TotalAndPhys) then             \n                return A.Backstab:Show(icon)\n            end\n        end\n        \n        -- [[ Cooldowns ]]\n        local function Cooldowns()\n            local Item = UseItems(unitID)\n            if Item and Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 then \n                return Item:Show(icon)\n            end \n        end\n        --# Use Dance off-gcd before the first Shuriken Storm from Tornado comes in.\n        --actions.cds=shadow_dance,use_off_gcd=1,if=!buff.shadow_dance.up&buff.shuriken_tornado.up&buff.shuriken_tornado.remains<=3.5\n        if A.ShadowDance:IsReadyByPassCastGCD(player) and Unit(player):HasBuffs(A.ShadowDanceBuff.ID, true) == 0 and Unit(player):HasBuffs(A.ShurikenTornado.ID, true) > 0 and Unit(player):HasBuffs(A.ShurikenTornado.ID, true) <= 3.5 then\n            return A.ShadowDance:Show(icon)\n        end\n        --# (Unless already up because we took Shadow Focus) use Symbols off-gcd before the first Shuriken Storm from Tornado comes in.\n        --actions.cds+=/symbols_of_death,use_off_gcd=1,if=buff.shuriken_tornado.up&buff.shuriken_tornado.remains<=3.5\n        if A.SymbolsofDeath:IsReadyByPassCastGCD(player) and Unit(player):HasBuffs(A.ShurikenTornado.ID, true) > 0 and Unit(player):HasBuffs(A.ShurikenTornado.ID, true) <= 3.5 then\n            return A.SymbolsofDeath:Show(icon)\n        end\n        --actions.cds+=/flagellation,if=variable.snd_condition&!stealthed.mantle\n        --            if A.Flagellation:IsReady(unitID) and sndcondition and not inStealth then\n        --                return A.Flagellation:Show(icon)\n        --            end            \n        --actions.cds+=/flagellation_cleanse,if=debuff.flagellation.remains<2\n        --            if A.ClaimFlagellation:IsReadyByPassCastGCD(unitID, nil, nil, true) and Unit(unitID):HasDeBuffs(A.Flagellation.ID, true) < 2 then\n        --                return A.ClaimFlagellation:Show(icon)\n        --            end\n        --actions.cds+=/vanish,if=(runeforge.mark_of_the_master_assassin&combo_points.deficit<=3|runeforge.deathly_shadows&combo_points<1)&buff.symbols_of_death.up&buff.shadow_dance.up&master_assassin_remains=0&buff.deathly_shadows.down\n        if A.Vanish:IsReady(player) and isBurst and Unit(unitID):TimeToDie() > 200 and (MarkoftheMasterAssassinEquipped and Player:ComboPointsDeficit() <= 3 or DeathlyShadowsEquipped and Player:ComboPoints() < 1)\n        and Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 and Unit(player):HasBuffs(A.ShadowDanceBuff.ID, true) > 0 and Player:GetCritChance() < 100\n        and Unit(player):HasBuffs(A.DeathlyShadowsBuff.ID, true) == 0 then\n            return A.Vanish:Show(icon)\n        end\n        --# Pool for Tornado pre-SoD with ShD ready when not running SF.\n        --actions.cds+=/pool_resource,for_next=1,if=talent.shuriken_tornado.enabled&!talent.shadow_focus.enabled\n        if not A.ShadowFocus:IsSpellLearned() and Player:Energy() < energyPoolBurst and Unit(player):HasBuffs(A.ShadowDanceBuff.ID, true) == 0 then\n            return A.PoolResource:Show(icon)\n        end\n        --# Use Tornado pre SoD when we have the energy whether from pooling without SF or just generally.\n        --actions.cds+=/shuriken_tornado,if=energy>=60&variable.snd_condition&cooldown.symbols_of_death.up&cooldown.shadow_dance.charges>=1\n        if A.ShurikenTornado:IsReady(unitID) and Unit(player):HasBuffs(A.SliceandDice.ID, true) > 0 and A.SymbolsofDeath:GetCooldown() == 0 and A.ShadowDance:GetSpellCharges() >= 1 then\n            if Player:Energy() >= energyPoolBurst then\n                return A.ShurikenTornado:Show(icon)\n            else \n                return A.PoolResource:Show(icon)\n            end            \n        end\n        --actions.cds+=/serrated_bone_spike,cycle_targets=1,if=variable.snd_condition&!dot.serrated_bone_spike_dot.ticking&target.time_to_die>=21|fight_remains<=5&spell_targets.shuriken_storm<3\n        if A.SerratedBoneSpike:IsReady(unitID) and (Unit(player):HasBuffs(A.SliceandDice.ID, true) > 0 and Unit(unitID):HasDeBuffs(A.FracturedBoneShards.ID, true) == 0 or Unit(unitID):TimeToDie() < 5) then\n            return A.SerratedBoneSpike:Show(icon)\n        end\n        --actions.cds+=/sepsis,if=variable.snd_condition&combo_points.deficit>=1\n        if A.Sepsis:IsReady(player) and sndcondition and Player:ComboPointsDeficit() >= 1 then\n            return A.Sepsis:Show(icon)\n        end\n        --# Use Symbols on cooldown (after first SnD) unless we are going to pop Tornado and do not have Shadow Focus.\n        --actions.cds+=/symbols_of_death,if=variable.snd_condition&(talent.enveloping_shadows.enabled|cooldown.shadow_dance.charges>=1)&(!talent.shuriken_tornado.enabled|talent.shadow_focus.enabled|cooldown.shuriken_tornado.remains>2)\n        if A.SymbolsofDeath:IsReadyByPassCastGCD(player) and sndcondition and (A.EnvelopingShadows:IsSpellLearned() or A.ShadowDance:GetSpellCharges() >= 1) and (not A.ShurikenTornado:IsSpellLearned() or A.ShadowFocus:IsSpellLearned() or A.ShurikenTornado:GetCooldown() > 2) then--and A.ShadowDance:GetCooldown() > 0 and (A.EnvelopingShadows:IsSpellLearned() or A.ShadowDance:GetSpellCharges() >= 1) and (not A.ShurikenTornado:IsSpellLearned() or A.ShadowFocus:IsSpellLearned() or A.ShurikenStorm:GetCooldown() > 2) then\n            return A.SymbolsofDeath:Show(icon)\n        end\n        --# If adds are up, snipe the one with lowest TTD. Use when dying faster than CP deficit or not stealthed without any CP.\n        --actions.cds+=/marked_for_death,target_if=min:target.time_to_die,if=raid_event.adds.up&(target.time_to_die<combo_points.deficit|!stealthed.all&combo_points.deficit>=cp_max_spend)\n        if A.MarkedForDeath:IsReadyByPassCastGCD(unitID, nil, nil, true) and (Unit(unitID):TimeToDie() > 15 or (Unit(unitID):TimeToDie() < Player:ComboPointsDeficit() or not inStealth and Player:ComboPointsDeficit() >= 5)) then\n            return A.MarkedForDeath:Show(icon)\n        end\n        --# If no adds will die within the next 30s, use MfD on boss without any CP.\n        --actions.cds+=/marked_for_death,if=raid_event.adds.in>30-raid_event.adds.duration&combo_points.deficit>=cp_max_spend\n        --actions.cds+=/shadow_blades,if=variable.snd_condition&combo_points.deficit>=2\n        if A.ShadowBlades:IsReadyByPassCastGCD(player) and isBurst and sndcondition and Player:ComboPointsDeficit() >= 2 then\n            return A.ShadowBlades:Show(icon)\n        end\n        --actions.cds+=/echoing_reprimand,if=variable.snd_condition&combo_points.deficit>=2&(variable.use_priority_rotation|spell_targets.shuriken_storm<=4)\n        if A.EchoingReprimand:IsReady(unitID) and sndcondition and Player:ComboPointsDeficit() >= 2 and (isPrioRotation or not GetByRange(5, 10)) then\n            return A.EchoingReprimand:Show(icon)\n        end\n        --# With SF, if not already done, use Tornado with SoD up.\n        --actions.cds+=/shuriken_tornado,if=talent.shadow_focus.enabled&variable.snd_condition&buff.symbols_of_death.up\n        if A.ShurikenTornado:IsReady(unitID) and A.ShadowFocus:IsSpellLearned() and Unit(player):HasBuffs(A.SliceandDice.ID, true) > 0 and Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 then\n            return A.ShurikenTornado:Show(icon)\n        end\n        --actions.cds+=/shadow_dance,if=!buff.shadow_dance.up&fight_remains<=8+talent.subterfuge.enabled\n        if A.ShadowDance:IsReadyByPassCastGCD(player) and Unit(player):HasBuffs(A.ShadowDanceBuff.ID, true) == 0 and Unit(unitID):TimeToDie() > 8 then\n            return A.ShadowDance:Show(icon)\n        end\n        --actions.cds+=/potion,if=buff.bloodlust.react|buff.symbols_of_death.up&(buff.shadow_blades.up|cooldown.shadow_blades.remains<=10)\n        --actions.cds+=/blood_fury,if=buff.symbols_of_death.up\n        if A.BloodFury:IsRacialReady(unitID, true) and isBurst and Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 then\n            return A.BloodFury:Show(icon)\n        end\n        --actions.cds+=/berserking,if=buff.symbols_of_death.up\n        if A.Berserking:IsRacialReady(unitID, true) and Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 then\n            return A.Berserking:Show(icon)\n        end\n        --actions.cds+=/fireblood,if=buff.symbols_of_death.up\n        if A.Fireblood:IsRacialReady(unitID, true) and Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 then\n            return A.Fireblood:Show(icon)\n        end\n        --actions.cds+=/ancestral_call,if=buff.symbols_of_death.up\n        if A.AncestralCall:IsRacialReady(unitID, true) and Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 then\n            return A.AncestralCall:Show(icon)\n        end\n        --# Default fallback for usable items: Use with Symbols of Death.\n        --actions.cds+=/use_items,if=buff.symbols_of_death.up|fight_remains<20\n        local Item = UseItems(unitID)\n        if Item and Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 then \n            return Item:Show(icon)\n        end\n        \n        -- [[ Finishers ]]\n        local function Finish()\n            --# While using Premeditation, avoid casting Slice and Dice when Shadow Dance is soon to be used, except for Kyrian\n            --actions.finish=variable,name=premed_snd_condition,value=talent.premeditation.enabled&spell_targets<(5-covenant.necrolord)&!covenant.kyrian\n            local varPremedsndcondition = A.Premeditation:IsSpellLearned() and not GetByRange(5, 10) and not A.EchoingReprimand:IsSpellLearned()\n            --actions.finish+=/slice_and_dice,if=!variable.premed_snd_condition&spell_targets.shuriken_storm<6&!buff.shadow_dance.up&buff.slice_and_dice.remains<fight_remains&refreshable\n            if A.SliceandDice:IsReady(unitID) and not varPremedsndcondition and not GetByRange(6, 10) and Unit(player):HasBuffs(A.ShadowDanceBuff.ID, true) == 0 and Unit(player):HasBuffs(A.SliceandDice.ID, true) < Unit(unitID):TimeToDie() and Unit(player):HasBuffs(A.SliceandDice.ID, true) < GetGCD() then\n                return A.SliceandDice:Show(icon)\n            end\n            --actions.finish+=/slice_and_dice,if=variable.premed_snd_condition&cooldown.shadow_dance.charges_fractional<1.75&buff.slice_and_dice.remains<cooldown.symbols_of_death.remains&(cooldown.shadow_dance.ready&buff.symbols_of_death.remains-buff.shadow_dance.remains<1.2)\n            --# Helper Variable for Rupture. Skip during Master Assassin or during Dance with Dark and no Nightstalker.\n            --actions.finish+=/variable,name=skip_rupture,value=master_assassin_remains>0|!talent.nightstalker.enabled&talent.dark_shadow.enabled&buff.shadow_dance.up|spell_targets.shuriken_storm>=5\n            local varSkipRupture = Unit(player):HasBuffs(A.MasterAssassinsMark.ID, true) > 0 or not A.Nightstalker:IsSpellLearned() and A.DarkShadow:IsSpellLearned() and Unit(player):HasBuffs(A.ShadowDanceBuff.ID, true) > 0 or GetByRange(5, 10)\n            --# Keep up Rupture if it is about to run out.\n            --actions.finish+=/rupture,if=!variable.skip_rupture&target.time_to_die-remains>6&refreshable\n            if A.Rupture:IsReady(unitID) and not varSkipRupture and Unit(unitID):TimeToDie() - Unit(unitID):HasDeBuffs(A.Rupture.ID, true) > 6 and Unit(unitID):HasDeBuffs(A.Rupture.ID, true) < 6 and A.Rupture:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.Rupture:Show(icon)\n            end\n            --actions.finish+=/secret_technique\n            if A.SecretTechnique:IsReady(unitID) and A.SecretTechnique:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.SecretTechnique:Show(icon)\n            end\n            --# Multidotting targets that will live for the duration of Rupture, refresh during pandemic.\n            --actions.finish+=/rupture,cycle_targets=1,if=!variable.skip_rupture&!variable.use_priority_rotation&spell_targets.shuriken_storm>=2&target.time_to_die>=(5+(2*combo_points))&refreshable\n            if A.Rupture:IsReady(unitID) and not varSkipRupture and not isPrioRotation and GetByRange(2, 10) and Unit(unitID):TimeToDie() >= (5 + (2 * Player:ComboPoints())) and Unit(unitID):HasDeBuffs(A.Rupture.ID, true) < 6 and A.Rupture:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.Rupture:Show(icon)\n            end\n            --# Refresh Rupture early if it will expire during Symbols. Do that refresh if SoD gets ready in the next 5s.\n            --actions.finish+=/rupture,if=!variable.skip_rupture&remains<cooldown.symbols_of_death.remains+10&cooldown.symbols_of_death.remains<=5&target.time_to_die-remains>cooldown.symbols_of_death.remains+5\n            if A.Rupture:IsReady(unitID) and not varSkipRupture and Unit(unitID):HasDeBuffs(A.Rupture.ID, true) < A.SymbolsofDeath:GetCooldown() + 10 and A.SymbolsofDeath:GetCooldown() <= 5 and Unit(unitID):TimeToDie() - Unit(unitID):HasDeBuffs(A.Rupture.ID, true) > A.SymbolsofDeath:GetCooldown() + 5 and A.Rupture:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.Rupture:Show(icon)\n            end\n            --actions.finish+=/black_powder,if=!variable.use_priority_rotation&spell_targets>=4-debuff.find_weakness.down\n            if A.BlackPowder:IsReady(unitID) and inAoE and GetByRange(3, 10) then\n                return A.ShroudOfConcealment:Show(icon)\n            end\n            --actions.finish+=/eviscerate\n            if A.Eviscerate:IsReady(unitID) and A.Eviscerate:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.Eviscerate:Show(icon)\n            end\n        end\n        \n        -- [[ Stealth Cooldowns ]]\n        local function StealthCDs()\n            --# Helper Variable\n            --actions.stealth_cds=variable,name=shd_threshold,value=cooldown.shadow_dance.charges_fractional>=1.75\n            local varShDThreshold = A.ShadowDance:GetSpellChargesFrac() >= 1.75\n            --# Vanish if we are capping on Dance charges. Early before first dance if we have no Nightstalker but Dark Shadow in order to get Rupture up (no Master Assassin).\n            --actions.stealth_cds+=/vanish,if=(!variable.shd_threshold|!talent.nightstalker.enabled&talent.dark_shadow.enabled)&combo_points.deficit>1&!runeforge.mark_of_the_master_assassin\n            if A.Vanish:IsReady(unitID) and isBurst and Unit(unitID):TimeToDie() > 200 and (not varShDThreshold or not A.Nightstalker:IsSpellLearned() and A.DarkShadow:IsSpellLearned())\n            and Player:ComboPointsDeficit() > 1 and not MarkoftheMasterAssassinEquipped then\n                return A.Vanish:Show(icon)\n            end\n            --# Pool for Shadowmeld + Shadowstrike unless we are about to cap on Dance charges. Only when Find Weakness is about to run out.\n            --actions.stealth_cds+=/pool_resource,for_next=1,extra_amount=40,if=race.night_elf\n            --actions.stealth_cds+=/shadowmeld,if=energy>=40&energy.deficit>=10&!variable.shd_threshold&combo_points.deficit>1&debuff.find_weakness.remains<1\n            --# CP thresholds for entering Shadow Dance\n            --actions.stealth_cds+=/variable,name=shd_combo_points,value=combo_points.deficit>=2+buff.shadow_blades.up\n            local varShDComboPoints = Player:ComboPointsDeficit() >= 2 + num(Unit(player):HasBuffs(A.ShadowBlades.ID) > 0)\n            --actions.stealth_cds+=/variable,name=shd_combo_points,value=combo_points.deficit>=3,if=covenant.kyrian\n            if A.EchoingReprimand:IsSpellLearned() then\n                varShDComboPoints = Player:ComboPointsDeficit() >= 3\n            end\n            --actions.stealth_cds+=/variable,name=shd_combo_points,value=combo_points.deficit<=1,if=variable.use_priority_rotation&spell_targets.shuriken_storm>=4\n            if isPrioRotation and GetByRange(4, 10) then\n                varShDComboPoints = Player:ComboPointsDeficit() <= 1\n            end\n            --# Dance during Symbols or above threshold.\n            --actions.stealth_cds+=/shadow_dance,if=variable.shd_combo_points&(variable.shd_threshold|buff.symbols_of_death.remains>=1.2|spell_targets.shuriken_storm>=4&cooldown.symbols_of_death.remains>10)\n            if A.ShadowDance:IsReadyByPassCastGCD(player) and varShDComboPoints and (varShDThreshold or Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) >= 1.2 or GetByRange(4, 10) and A.SymbolsofDeath:GetCooldown() > 10) then\n                return A.ShadowDance:Show(icon)\n            end\n            --# Burn remaining Dances before the fight ends if SoD won't be ready in time.\n            --actions.stealth_cds+=/shadow_dance,if=variable.shd_combo_points&fight_remains<cooldown.symbols_of_death.remains\n            if A.ShadowDance:IsReadyByPassCastGCD(player) and varShDComboPoints and Unit(unitID):TimeToDie() < A.SymbolsofDeath:GetCooldown() then\n                return A.ShadowDance:Show(icon)\n            end\n        end\n        \n        -- [[ Stealthed Rotation  ]] \n        local function Stealthed()\n            --# If Stealth/vanish are up, use Shadowstrike to benefit from the passive bonus and Find Weakness, even if we are at max CP (from the precombat MfD).\n            --actions.stealthed=shadowstrike,if=(buff.stealth.up|buff.vanish.up)\n            if A.Shadowstrike:IsReady(unitID) and Unit(player):HasBuffs(Temp.StealthBuff, true) > 0 and A.Shadowstrike:AbsentImun(unitID, Temp.TotalAndPhys) and not GetByRange(3, 10) then\n                return A.Shadowstrike:Show(icon)\n            end\n            --# Finish at 3+ CP without DS / 4+ with DS with Shuriken Tornado buff up to avoid some CP waste situations.\n            --actions.stealthed+=/call_action_list,name=finish,if=buff.shuriken_tornado.up&combo_points.deficit<=2\n            if Unit(player):HasBuffs(A.ShurikenTornado.ID, true) > 0 and Player:ComboPointsDeficit() <= 2 and Finish() then\n                return true\n            end\n            --# Also safe to finish at 4+ CP with exactly 4 targets. (Same as outside stealth.)\n            --actions.stealthed+=/call_action_list,name=finish,if=spell_targets.shuriken_storm>=4&combo_points>=4\n            if GetByRange(4, 10) and Player:ComboPoints() >= 4 and Finish() then\n                return true\n            end\n            --# Finish at 4+ CP without DS, 5+ with DS, and 6 with DS after Vanish\n            --actions.stealthed+=/call_action_list,name=finish,if=combo_points.deficit<=1-(talent.deeper_stratagem.enabled&buff.vanish.up)\n            if Player:ComboPointsDeficit() <= 1 - num(A.DeeperStratagem:IsSpellLearned() and Unit(player):HasBuffs(A.VanishBuff.ID, true) > 0) and Finish() then\n                return true\n            end\n            --actions.stealthed+=/shiv,if=talent.nightstalker.enabled&runeforge.tiny_toxic_blade&spell_targets.shuriken_storm<5\n            if A.Shiv:IsReady(unitID) and A.Nightstalker:IsSpellLearned() and TinyToxicBladeEquipped and not GetByRange(5, 10) then\n                return A.Shiv:Show(icon)\n            end\n            --# Up to 3 targets keep up Find Weakness by cycling Shadowstrike.\n            --actions.stealthed+=/shadowstrike,cycle_targets=1,if=debuff.find_weakness.remains<1&spell_targets.shuriken_storm<=3&target.time_to_die-remains>6\n            if A.Shadowstrike:IsReady(unitID) and Unit(unitID):HasDeBuffs(A.FindWeaknessDebuff.ID, true) < 1 and Unit(unitID):TimeToDie() - Unit(unitID):HasDeBuffs(A.FindWeaknessDebuff.ID, true) > 6 and A.Shadowstrike:AbsentImun(unitID, Temp.TotalAndPhys)  and not GetByRange(3, 10) then\n                return A.Shadowstrike:Show(icon)\n            end\n            --# For priority rotation, use Shadowstrike over Storm with WM against up to 4 targets or if FW is running off (on any amount of targets)\n            --actions.stealthed+=/shadowstrike,if=variable.use_priority_rotation&(debuff.find_weakness.remains<1|talent.weaponmaster.enabled&spell_targets.shuriken_storm<=4)\n            if A.Shadowstrike:IsReady(unitID) and isPrioRotation and (Unit(unitID):HasDeBuffs(A.FindWeaknessDebuff.ID, true) < 1 or A.WeaponMaster:IsSpellLearned() and not GetByRange(5, 10) and A.Shadowstrike:AbsentImun(unitID, Temp.TotalAndPhys)) then\n                return A.Shadowstrike:Show(icon)\n            end\n            --actions.stealthed+=/shuriken_storm,if=spell_targets>=3+(buff.the_rotten.up|runeforge.akaaris_soul_fragment&conduit.deeper_daggers.rank>=7)&(buff.symbols_of_death_autocrit.up|!buff.premeditation.up|spell_targets>=5)\n            if A.ShurikenStorm:IsReady(unitID) and GetByRange(3, 10) and (Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 or Unit(player):HasBuffs(A.Premeditation.ID, true) == 0 or GetByRange(5, 10)) then\n                return A.ShurikenStorm:Show(icon)\n            end\n            --# Shadowstrike to refresh Find Weakness and to ensure we can carry over a full FW into the next SoD if possible.\n            --actions.stealthed+=/shadowstrike,if=debuff.find_weakness.remains<=1|cooldown.symbols_of_death.remains<18&debuff.find_weakness.remains<cooldown.symbols_of_death.remains\n            if A.Shadowstrike:IsReady(unitID) and Unit(unitID):HasDeBuffs(A.FindWeaknessDebuff.ID, true) <= 1 or A.SymbolsofDeath:GetCooldown() < 18 and Unit(unitID):HasDeBuffs(A.FindWeaknessDebuff.ID, true) < A.SymbolsofDeath:GetCooldown() and A.Shadowstrike:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.Shadowstrike:Show(icon)\n            end\n            --actions.stealthed+=/gloomblade,if=buff.perforated_veins.stack>=5&conduit.perforated_veins.rank>=13\n            --actions.stealthed+=/shadowstrike\n            if A.Shadowstrike:IsReady(unitID) and A.Shadowstrike:AbsentImun(unitID, Temp.TotalAndPhys) then\n                return A.Shadowstrike:Show(icon)\n            end\n        end\n        if GetToggle(2, \"TricksFocus\") and Unit(\"focus\"):IsExists() and A.TricksOfTheTrade:IsReady(\"focus\") and ((BossMods:GetPullTimer() > .1 and BossMods:GetPullTimer() <= 2.5) or inCombat > 0) and IsUnitFriendly(\"focus\") then\n            return A.TricksOfTheTrade:Show(icon)    \n        end        \n        if A.SliceandDice:IsReady(player) and not GetByRange(6, 10) and Unit(player):HasBuffs(A.SliceandDice.ID, true) < Unit(unitID):TimeToDie() and Unit(player):HasBuffs(A.SliceandDice.ID, true) < GetGCD() and Player:ComboPoints() >= 4 - (Unit(player):CombatTime() < 10 and 2 or 0) then\n            return A.SliceandDice:Show(icon)\n        end\n        --# Check CDs at first\n        if InMelee(unitID) and forcecombat and (not Unit(unitID):IsExplosives() and not Unit(unitID):IsTotem()) and Cooldowns() then\n            return true\n        end\n        --# Run fully switches to the Stealthed Rotation (by doing so, it forces pooling if nothing is available).\n        if forcecombat and inStealth and Stealthed() then\n            return true\n        end     \n        --# Priority Rotation? Let's give a crap about energy for the stealth CDs (builder still respect it). Yup, it can be that simple.\n        if InMelee(unitID) and forcecombat and (not Unit(unitID):IsExplosives() and not Unit(unitID):IsTotem()) and isPrioRotation and StealthCDs() then\n            return true\n        end\n        if InMelee(unitID) and forcecombat and (not Unit(unitID):IsExplosives() and not Unit(unitID):IsTotem()) and (Player:EnergyDeficit() <= stealthThreshold) and StealthCDs() then\n            return true\n        end\n        --finish,if=combo_points.deficit<=1|target.time_to_die<=1&combo_points>=3\n        if InMelee(unitID) and forcecombat and (Player:ComboPoints() == EchoingReprimandCP) and Finish() then\n            return true\n        end\n        \n        if InMelee(unitID) and forcecombat and ((Player:ComboPointsDeficit() <= 1 or (Unit(unitID):TimeToDie() <= 1 and Player:ComboPoints() >= 3) or (Unit(player):HasBuffs(A.SymbolsofDeath.ID, true) > 0 and Player:ComboPoints() >= 4)) and not inStealth) and Finish() then\n            return true\n        end\n        if InMelee(unitID) and forcecombat and (GetByRange(4, 10) and Player:ComboPoints() >= 4 and not inStealth)\n        and Finish() then\n            return true\n        end\n        --build,if=energy.deficit<=variable.stealth_threshold\n        if InMelee(unitID) and forcecombat and Player:EnergyDeficit() <= stealthThreshold and Build() then\n            return true\n        end\n        if unitID ~= \"mouseover\" and GetToggle(2, \"Shadowstep_Target\") and not inMelee and Player:IsMovingTime() > 2 and not Player:IsMounted() and A.ShadowStep:IsReady(unitID) and Unit(unitID):GetRange() >= GetToggle(2, \"Shadowstep_Distance\") then\n            return A.ShadowStep:Show(icon)\n        end\n    end\n    \n    function FriendlyRotation(unitID)\n        if GetToggle(2, \"ShadowStepMO\") and Player:IsMovingTime() > 1 and not Player:IsMounted() and A.ShadowStep:IsReady(unitID) and A.LastPlayerCastName ~= A.ShadowStep:Info() then\n            return A.ShadowStep:Show(icon)\n        end\n    end\n    \n    -- Mouseover\n    if IsUnitFriendly(\"mouseover\") and FriendlyRotation(\"mouseover\") then \n        return true             \n    end\n    \n    -- Target\n    if IsUnitEnemy(target) and not Unit(target):IsDead() then \n        if EnemyRotationPvE(target) then \n            return true \n        end\n    end\nend\n\n-- Nil (nothing for profile here, just reset them)\nA[1] = nil\nA[4] = nil\nA[5] = nil\nA[6] = nil\nA[7] = nil\nA[8] = nil",
