ction GetByRange(count, range, isCheckEqual, isCheckCombat)\n    -- @return boolean \n    local c = 0 \n    for unitID in pairs(ActiveUnitPlates) do \n        if (not isCheckEqual or not UnitIsUnit(target, unitID)) and (not isCheckCombat or Unit(unitID):CombatTime() > 0) then \n            if range then \n                local r = Unit(unitID):GetRange()\n                if r > 0 and r <= range then \n                    c = c + 1\n                end \n            end \n            \n            if c >= count then \n                return true \n            end \n        end \n    end\nend \n\nlocal function GetByRangeTTD(self, count, range)\n    -- @return number\n    local total, total_ttd = 0, 0\n    \n    for unitID in pairs(ActiveUnitPlates) do \n        if not range or Unit(unitID):CanInterract(range) then \n            total = total + 1\n            total_ttd = total_ttd + Unit(unitID):TimeToDie()\n        end \n        \n        if count and total >= count then \n            break \n        end \n    end \n    \n    if total > 0 then \n        return total_ttd / total     \n    else  \n        return huge\n    end\nend \nGetByRangeTTD = A.MakeFunctionCachedDynamic(GetByRangeTTD)\n\n-- [1] CC AntiFake Rotation\nlocal function AntiFakeStun(unitID) \n    return \n    IsUnitEnemy(unitID) and  \n    Unit(unitID):GetRange() <= 40 and \n    Unit(unitID):IsControlAble(\"stun\", 0) and \n    A.IntimidationGreen:AbsentImun(unitID, Temp.AuraForOnlyCCAndStun, true)          \nend \nA[1] = function(icon)    \n    if A.IntimidationGreen:IsReady(nil, nil, nil, true) and \n    (\n        AntiFakeStun(\"mouseover\") or \n        AntiFakeStun(\"target\")\n    )\n    then \n        return A.IntimidationGreen:Show(icon)         \n    end                                                                     \nend\n\nlocal function SelfDefensives()\n    if Unit(player):CombatTime() == 0 then \n        return \n    end\n    \n    local Exhilaration = A.GetToggle(2, \"ExhilarationHP\")\n    if Exhilaration >= 0 and A.Exhilaration:IsReady(player) and \n    (\n        (     -- Auto \n            Exhilaration >= 100 and \n            (\n                -- HP lose per sec >= 20\n                Unit(player):GetDMG() * 100 / Unit(player):HealthMax() >= 20 or \n                Unit(player):GetRealTimeDMG() >= Unit(player):HealthMax() * 0.20 or \n                -- TTD \n                Unit(player):TimeToDieX(25) < 5 or \n                (\n                    A.IsInPvP and \n                    (\n                        Unit(player):UseDeff() or \n                        (\n                            Unit(player, 5):HasFlags() and \n                            Unit(player):GetRealTimeDMG() > 0 and \n                            Unit(player):IsFocused() \n                        )\n                    )\n                )\n            ) and \n            Unit(player):HasBuffs(\"DeffBuffs\", true) == 0\n        ) or \n        (    -- Custom\n            Exhilaration < 100 and \n            Unit(player):HealthPercent() <= Exhilaration\n        )\n    ) \n    then \n        return A.Exhilaration\n    end\n    \n    local AspectoftheTurtle = A.GetToggle(2, \"Turtle\")\n    if AspectoftheTurtle >= 0 and A.AspectoftheTurtle:IsReady(player) and \n    (\n        (     -- Auto \n            AspectoftheTurtle >= 100 and \n            (\n                -- HP lose per sec >= 30\n                Unit(player):GetDMG() * 100 / Unit(\"player\"):HealthMax() >= 30 or \n                Unit(player):GetRealTimeDMG() >= Unit(player):HealthMax() * 0.30 or \n                -- TTD \n                Unit(player):TimeToDieX(25) < 5 or \n                (\n                    A.IsInPvP and \n                    (\n                        Unit(player):UseDeff() or \n                        (\n                            Unit(player, 5):HasFlags() and \n                            Unit(player):GetRealTimeDMG() > 0 and \n                            Unit(player):IsFocused() \n                        )\n                    )\n                )\n            ) and \n            Unit(player):HasBuffs(\"DeffBuffs\", true) == 0\n        ) or \n        (    -- Custom\n            AspectoftheTurtle < 100 and \n            Unit(player):HealthPercent() <= AspectoftheTurtle\n        )\n    ) \n    then\n        return A.AspectoftheTurtle\n    end\n    -- PhialofSerenity\n    --            local PhialofSerenityHP, PhialofSerenityOperator, PhialofSerenityTTD = GetToggle(2, \"PhialofSerenityHP\"), GetToggle(2, \"PhialofSerenityOperator\"), GetToggle(2, \"PhialofSerenityTTD\")\n    --            if A.PhialofSerenity:IsReady(player) and\n    --            PhialofSerenityOperator == \"AND\" then \n    --                if (PhialofSerenityHP <= 0 or Unit(player):HealthPercent() <= PhialofSerenityHP) and (PhialofSerenityTTD <= 0 or Unit(player):TimeToDie() <= PhialofSerenityTTD) then \n    --                    return A.AbyssalHealingPotion\n    --                end \n    --            else\n    --                if A.PhialofSerenity:IsReady(player) and (PhialofSerenityHP > 0 and Unit(player):HealthPercent() <= PhialofSerenityHP) or (PhialofSerenityTTD > 0 and Unit(player):TimeToDie() <= PhialofSerenityTTD) then \n    --                    return A.AbyssalHealingPotion\n    --                end \n    --            end            \n    -- Dispel \n    --            if A.PhialofSerenity:IsReady(player) and AuraIsValidByPhialofSerenity() then \n    --                return A.AbyssalHealingPotion    \n    --    end    \nend\nSelfDefensives = A.MakeFunctionCachedStatic(SelfDefensives)\n\nlocal function MasterMarksmanBuffCheck()\n    return (Unit(player):HasBuffs(A.MasterMarksmanBuff) or (Unit(player):IsCasting(A.AimedShot) and A.MasterMarksman:IsSpellLearned()))\nend\n\nlocal function UseItems(player)\n    if A.Trinket1:IsReady(unitID) and A.Trinket1:GetItemCategory() ~= \"DEFF\" and not Temp.IsSlotTrinketBlocked[A.Trinket1.ID] and A.Trinket1:AbsentImun(unitID, Temp.TotalAndMagPhys) then \n        return A.Trinket1\n    end\n    \n    if A.Trinket2:IsReady(player) and A.Trinket2:GetItemCategory() ~= \"DEFF\" and not Temp.IsSlotTrinketBlocked[A.Trinket2.ID] and A.Trinket2:AbsentImun(unitID, Temp.TotalAndMagPhys) then \n        return A.Trinket2\n    end\nend\n\n\n-----------------------------------------\n--                 ROTATION  \n-----------------------------------------\n\n-- [3] Single Rotation\nA[3] = function(icon)\n    local isMoving                         = A.Player:IsMoving()\n    local unitID                        = \"player\"\n    local targetID                   = \"target\"\n    local isMovingOut                = Unit(targetID):IsMoving()\n    local inAoE                            = GetToggle(2, \"AoE\")\n    local inHoldAoE                        = GetToggle(2, \"holdAoE\")\n    local minHoldAoE                    = GetToggle(2, \"holdAoENum\") \n    local isStartAttack                    = GetToggle(2, \"startAttack\")\n    local forceAoE                        = GetToggle(2, \"forceAoE\")\n    local combatTime                    = Unit(player):CombatTime()\n    local inCombat                        = combatTime > 0\n    local enemies                        = GetEnemies()\n    local profileStop                    = false\n    local canCast                        = true\n    local VarCAExecute                     = Unit(unitID):HealthPercent() > 70\n    local SoulForgeEmbersEquipped         = GetToggle(2, \"SOULFORGE\")\n    local SurgingShotsEquiped             = GetToggle(2, \"SSHOTS\")\n    local Pull                             = Action.BossMods_Pulling()\n    local CovCDs                      = GetToggle(2, \"CovCDs\") or BurstIsON(unitID)\n    local VolleyCDs                     = GetToggle(2, \"VolleyCDs\") or BurstIsON(unitID)\n    local DTCDs                         = GetToggle(2, \"DTCDs\") or BurstIsON(unitID)\n    local MOVRA                            = GetToggle(2, \"MOVRA\") or UnitIsUnit(target, \"mouseover\")\n    local WSmin                            = GetToggle(2, \"WSmin\")\n    local BSCS                            = GetToggle(2, \"BSCS\")\n    local forcecombat            = GetToggle(2, \"FCOMBAT\") or inCombat\n    local AimedShotCurrentCharges, AimedShotMaxCharges, AimedShotCooldownStart, AimedShotCooldownDuration, AimedShotChargeModRate = GetSpellCharges(A.AimedShot.ID)\n    \n    -- Function to check if trinket is not on-use (spellID is empty or null)\n    local function isempty(s)\n        return s == nil or s == ''\n    end\n    \n    local canSteady = A.LastPlayerCastID == A.SteadyShot.ID and Unit(player):HasBuffs(A.SteadyFocus.ID) < 2 * (A.SteadyShot:GetSpellCastTime() + GetGCD() + GetLatency())\n    local shouldSteady = A.LastPlayerCastID ~= A.SteadyShot.ID and Unit(player):HasBuffs(A.SteadyFocus.ID) == 0\n    local shouldAimshotDuringVolley = A.AimedShot:IsReady(unitID) and\n    Unit(player):HasBuffs(A.Volley.ID) > (2.5-(2.5*(GetHaste(player)/100))) and --can fire one AimedShot before volley ends\n    Unit(player):HasBuffs(A.Volley.ID) > 0 and (\n        (A.LastPlayerCastID ~= A.AimedShot.ID) or\n        (\n            A.LastPlayerCastID == A.AimedShot.ID and\n            not A.RapidFire:IsReady(unit) and\n            A.RapidFire:GetSpellTimeSinceLastCast() > 4\n        ) or\n        (\n            Unit(player):HasBuffs(A.Trueshot.ID, true) > 0\n        )\n    )\n    local shouldRapidfireDuringVolley = A.RapidFire:IsReady(unitID) and Unit(player):HasBuffs(A.Volley.ID) > 0\n    \n    local t1itemId = GetInventoryItemID(\"player\", 13) -- Get Trinket1 ID\n    local t1spellName, t1spellID =  GetItemSpell(t1itemId) -- Get Spell ID related to Trinket1\n    if not isempty(t1spellName) then -- If there is a spell (on-use trinket)\n        local t1cooldownMS, t1gcdMS = GetSpellBaseCooldown(t1spellID) -- Get cooldown in MS\n        t1cooldown = (t1cooldownMS/1000) -- convert it to seconds\n    end\n    if isempty(t1spellName) then -- If there isn't a spell (not on-use trinket)\n        t1cooldown = 0\n    end\n    \n    local t2itemId = GetInventoryItemID(\"player\", 14) -- Get Trinket2 ID\n    local t2spellName, t2spellID =  GetItemSpell(t2itemId) -- Get Spell ID related to Trinket2\n    if not isempty(t2spellName) then -- If there is a spell (on-use trinket)\n        local t2cooldownMS, t2gcdMS = GetSpellBaseCooldown(t2spellID) -- Get cooldown in MS\n        t2cooldown = (t2cooldownMS/1000) -- convert it to seconds\n    end\n    if isempty(t2spellName) then -- If there isn't a spell (not on-use trinket)\n        t2cooldown = 0\n    end\n    \n    -- Trinket 1 usage\n    if A.Trinket1:IsReadyByPassCastGCD(unitID) and Unit(target):IsExists() and not Temp.IsSlotTrinketBlocked[A.Trinket1.ID] and    \n    (   -- If two on-uses are ready and competing for a Trueshot sync, assume the longer cd has a stronger effect and prefer that unless it's already on cooldown, otherwise use the one that's off cooldown\n        (\n            Unit(player):HasBuffs(A.Trueshot.ID, true) > 0 and\n            (\n                t1cooldown >= t2cooldown or\n                A.Trinket2:GetCooldown() > 0\n            )\n        ) or\n        \n        -- If a trinket is ready and another stronger (assumed from longer cooldown) on-use will also be ready by the time Trueshot comes back off cooldown, then use it if the shared 20 second cd it triggers won't interfere with the upcoming Trueshot sync'd on-use.\n        (\n            not A.Trueshot:IsReadyByPassCastGCD(unitID) and A.Trueshot:GetCooldown() > 20 and t2cooldown >= t1cooldown and A.Trinket2:GetCooldown() - 5 < A.Trueshot:GetCooldown()\n        ) or\n        \n        -- If a trinket could be used and still come back off cooldown for a future Trueshot, it's safe to use, preferring the longest cooldown if two are ready.\n        (\n            t1cooldown -5 < A.Trueshot:GetCooldown() and\n            (   \n                t1cooldown >= t2cooldown or\n                A.Trinket2:GetCooldown() > 0\n            )\n        ) or\n        \n        -- If the fight is going to end before your next Trueshot, and the target is a World/Raid Boss just start using trinket to make sure they get used.\n        (\n            Unit(target):TimeToDie() < A.Trueshot:GetCooldown() and partyMembers > 5 and -- partyMembers is already working\n            (\n                UnitClassification(\"target\") == \"worldboss\" or\n                UnitLevel(\"target\") == -1\n            )\n        ) \n    )\n    then\n        return A.Trinket1:Show(icon)\n    end\n    \n    -- Trinket 2 usage\n    if A.Trinket2:IsReadyByPassCastGCD(unitID) and Unit(target):IsExists() and not Temp.IsSlotTrinketBlocked[A.Trinket2.ID] and    \n    (    -- If two on-uses are ready and competing for a Trueshot sync, assume the longer cd has a stronger effect and prefer that unless it's already on cooldown, otherwise use the one that's off cooldown\n        (\n            Unit(player):HasBuffs(A.Trueshot.ID, true) > 0 and\n            (\n                t2cooldown >= t1cooldown or\n                A.Trinket1:GetCooldown() > 0\n            )\n        ) or\n        \n        -- If a trinket is ready and another stronger (assumed from longer cooldown) on-use will also be ready by the time Trueshot comes back off cooldown, then use it if the shared 20 second cd it triggers won't interfere with the upcoming Trueshot sync'd on-use.\n        (\n            not A.Trueshot:IsReadyByPassCastGCD(unitID) and A.Trueshot:GetCooldown() > 20 and t1cooldown >= t2cooldown and A.Trinket1:GetCooldown() - 5 < A.Trueshot:GetCooldown()\n        ) or\n        \n        -- If a trinket could be used and still come back off cooldown for a future Trueshot, it's safe to use, preferring the longest cooldown if two are ready.\n        (\n            t2cooldown -5 < A.Trueshot:GetCooldown() and\n            (   \n                t2cooldown >= t1cooldown or\n                A.Trinket1:GetCooldown() > 0\n            )\n        ) or\n        \n        -- If the fight is going to end before your next Trueshot, and the target is a World/Raid Boss just start using trinket to make sure they get used.\n        (\n            Unit(target):TimeToDie() < A.Trueshot:GetCooldown() and partyMembers > 5 and -- partyMembers is already working\n            (\n                UnitClassification(\"target\") == \"worldboss\" or\n                UnitLevel(\"target\") == -1\n            )\n        )\n    )\n    then\n        return A.Trinket2:Show(icon)\n    end\n    \n    local function num(val)\n        if val then return 1 else return 0 end\n    end\n    \n    if (Player:IsCasting() or Player:IsChanneling()) then\n        canCast = false\n    else \n        canCast = true\n    end\n    \n    if Temp.FeignDeathDelay > 0 then\n        Temp.FeignDeathDelay = Temp.FeignDeathDelay - 1\n        return \n    end\n    \n    Temp.PetFamily = UnitCreatureFamily(Pet:GetMainPet() and Pet:GetMainPet().name or pet)\n    \n    local function EnemyRotation(unitID)    \n        \n        local unit = \"target\"        \n        local MendPet = GetToggle(2, \"MendPet\")\n        if A.MendPet:IsReady(player) and Pet:IsActive() and Unit(pet):HealthPercent() > 0 and ((MendPet >= 100 and (Unit(pet):GetDMG() * 100 / Unit(pet):HealthMax() >= 20 or Unit(pet):GetRealTimeDMG() >= Unit(pet):HealthMax() * 0.20 or Unit(pet):TimeToDieX(15) < 2)) or (MendPet < 100 and Unit(pet):HealthPercent() <= MendPet and Unit(pet):HasBuffs(A.MendPet.ID) == 0))    then\n            return A.MendPet:Show(icon)\n        end\n        \n        -- Purge\n        if A.ArcaneTorrent:AutoRacial(unitID) then \n            return A.ArcaneTorrent:Show(icon)\n        end   \n        \n        -- [[ INTERRUPTS ]] \n        local useKick, useCC, useRacial, notInterruptable, castRemainsTime, castDoneTime = InterruptIsValid(unitID, nil, nil, not A.CounterShot:IsReady(unitID)) -- A.CounterShot non GCD spell\n        \n        if castDoneTime > 0 then\n            if useKick and not notInterruptable and A.CounterShot:IsReady(unitID) then\n                return A.CounterShot:Show(icon)\n            end\n            \n            if useRacial and A.QuakingPalm:AutoRacial(unitID) then \n                return A.QuakingPalm:Show(icon)\n            end \n            \n            if useRacial and A.Haymaker:AutoRacial(unitID) then \n                return A.Haymaker:Show(icon)\n            end \n            \n            if useRacial and A.WarStomp:AutoRacial(unitID) then \n                return A.WarStomp:Show(icon)\n            end \n            \n            if useRacial and A.BullRush:AutoRacial(unitID) then \n                return A.BullRush:Show(icon)\n            end   \n        end\n        \n        -- Explosives or Totems\n        if canCast and (Unit(unitID):IsExplosives() or Unit(unitID):IsTotem()) then\n            if A.ArcaneShot:IsReady(unitID) then\n                return A.ArcaneShot:Show(icon)\n            end\n            \n            if A.SteadyShot:IsReady(unitID) then\n                return A.SteadyShot:Show(icon)\n            end\n        end\n        \n        -- Dispell Enrage / Magic\n        if A.TranquilizingShot:IsReady(unitID) and (AuraIsValid(unitID, \"UseExpelEnrage\", \"Enrage\") or AuraIsValid(unitID, \"UseDispel\", \"Magic\")) then \n            return A.TranquilizingShot:Show(icon)\n        end \n        \n        local canBurst = false\n        if (Unit(unitID):TimeToDie() >= GetToggle(2, \"BurstTTDBoss\") or Unit(unitID):TimeToDie() >= GetToggle(2, \"BurstTTDMobs\")) then\n            canBurst = true\n        end\n        \n        -- Torghast Jars\n        if UnitName(targetID)==\"Aschenes Phylakterium\" or UnitName(targetID)==\"Ashen Phylactery\" or UnitName(targetID)==\"Filacteria cinérea\" or UnitName(targetID)==\"Phylactère cendreux\" or UnitName(targetID)==\"Filatterio Cinereo\" or UnitName(targetID)==\"Filactério Cinzento\" or UnitName(targetID)==\"Phylactery with ashes\" or UnitName(targetID)==\"잿빛 성물함\" or UnitName(targetID)==\"灰烬护命匣\" then\n            if A.Multishot:IsReady(unitID) then\n                return A.Multishot:Show(icon)\n            end\n            \n            if A.SteadyShot:IsReady(unitID) then\n                return A.SteadyShot:Show(icon)\n            end\n        end          \n        if Player:CastRemains(A.SteadyShot.ID, true) > .5 and Player:Focus() > 70 and Unit(player):HasBuffs(A.SteadyFocus.ID) > 8 then\n            return A.StopCast:Show(icon)\n        end\n        if Player:CastRemains(A.AimedShot.ID, true) > .1 and inAoE and Unit(player):HasBuffs(A.TrickShotsBuff.ID, true) == 0 then\n            return A.StopCast:Show(icon)\n        end\n        if Player:CastRemains(A.AimedShot.ID, true) > 1.1 and not inAoE and Unit(player):HasBuffs(A.PreciseShotsBuff.ID) > 0 and Unit(player):HasBuffs(A.TrueshotBuff.ID) == 0 and A.AimedShot:GetSpellChargesFullRechargeTime() > (GetGCD() + GetCurrentGCD() + A.AimedShot:GetSpellCastTime()) then\n            return A.StopCast:Show(icon)\n        end\n        \n        -- local function PreCombat()\n        --     if A.DoubleTap:IsReady(unitID, true) and A.SteadyShot:IsReady(unitID) and ((Unit(unitID):GetRange() <= 40 and canBurst) and Pull > .1 and Pull <= 10) and DTCDs then\n        --         return A.DoubleTap:Show(icon)\n        --     end\n        --     --actions.precombat+=/aimed_shot,if=active_enemies<3&(!covenant.kyrian&!talent.volley|active_enemies<2)\n        --     if A.AimedShot:IsReady(unitID) and enemies < 3 and (not A.ResonatingArrow:IsSpellLearned() and not A.Volley:IsSpellLearned() or enemies < 2) and Pull > .1 and Pull <= A.AimedShot:GetSpellCastTime() then\n        --         return A.AimedShot:Show(icon)\n        --     end\n        -- end\n        local function CD()\n            if A.Berserking:IsRacialReady(unitID, true) and Unit(player):HasBuffs(A.TrueshotBuff.ID) > 0 then\n                return A.Berserking:Show(icon)\n            end\n            if A.BloodFury:IsRacialReady(unitID, true) and Unit(player):HasBuffs(A.TrueshotBuff.ID) > 0 then\n                return A.BloodFury:Show(icon)\n            end\n            if A.AncestralCall:IsRacialReady(unitID, true) and Unit(player):HasBuffs(A.TrueshotBuff.ID) > 0 then\n                return A.AncestralCall:Show(icon)\n            end\n            if A.Fireblood:IsRacialReady(unitID, true) and Unit(player):HasBuffs(A.TrueshotBuff.ID) > 0 then\n                return A.Fireblood:Show(icon)\n            end\n            if A.LightsJudgment:IsRacialReady(unitID, true) and Unit(player):HasBuffs(A.TrueshotBuff.ID) == 0 then\n                return A.LightsJudgment:Show(icon)\n            end\n            if A.BagofTricks:IsRacialReady(unitID, true) and Unit(player):HasBuffs(A.TrueshotBuff.ID) == 0 then\n                return A.BagofTricks:Show(icon)\n            end\n        end \n        local function ST()\n            --actions.precombat+=/aimed_shot,if=active_enemies<3&(!covenant.kyrian&!talent.volley|active_enemies<2)\n            if (A.AimedShot:IsReady(unitID) or Unit(player):HasBuffs(A.LockAndLoadBuff.ID) > 0) and\n            Unit(targetID):CombatTime() == 0 and\n            Unit(player):CombatTime() == 0 and\n            AimedShotCurrentCharges == 2 and\n            not A.IsInPvP and\n            (\n                not isMoving or\n                Unit(player):HasBuffs(A.LockAndLoadBuff.ID) > 0\n            ) then\n                return A.AimedShot:Show(icon)\n            end\n            --actions.st=steady_shot,if=talent.steady_focus&(prev_gcd.1.steady_shot&buff.steady_focus.remains<5|buff.steady_focus.down)\n            if A.SteadyFocus:IsSpellLearned() and\n            canSteady then\n                return A.SteadyShot:Show(icon)\n            end\n            if A.SteadyFocus:IsSpellLearned() and\n            shouldSteady then\n                return A.SteadyShot:Show(icon)\n            end\n            --actions.st+=/kill_shot\n          